DELIMITER $$
CREATE TRIGGER `update_level` BEFORE INSERT ON `users` FOR EACH ROW BEGIN

    IF (NEW.user_weightage >=0 && NEW.user_weightage <=25) THEN
      SET NEW.user_level = 1;
    END IF;
 

END
$$
DELIMITER ;

