INSERT INTO `course_topics` (`topic_id`, `topic_name`, `topic_text`, `course_idFK`, `created_at`, `updated_at`, `created_by`, `updated_by`, `topic_level_id`) VALUES
(1, 'Introduction To Computer Science', 'We begin this course by developing a motivation for learning programming concepts and by reviewing the history of computer programming languages, and show the connections between human thought and its expression in programming languages. We then discuss hardware – the physical devices that make up a computer – and software – operating systems and applications that run on the computer.', 1, NULL, NULL, NULL, NULL, 1),
(2, 'Object-Oriented Programming', 'Java is an object-oriented programming language. Object-oriented (OO) programming has proven to be one of the most effective and flexible programming paradigms. This unit will begin with a discussion of what makes OO programming so unique, and why its advantages have made it the industry-standard paradigm for newly designed programs.', 1, NULL, NULL, NULL, NULL, 2),
(3, 'Java in Practice', 'This topic discusses naming and coding conventions as well as reserved words in Java. When you go through this chapter, you\'ll get some hands-on experience with writing in Java.', 1, NULL, NULL, NULL, NULL, 3),
(4, 'Introduction to physics', 'Physics is the branch of science which deals with matter and its relation to energy.\r\nIt involves study of physical and natural phenomena around us. Examples of these phenomena are formation of rainbow, occurrence eclipse, the fall of things from up to down, the cause of sunset and sunrise, formation of shadow and many more.', 2, NULL, NULL, NULL, NULL, 1),
(5, 'Vectors', 'In mathematics and physics, vectors are measures that have both direction and size. Learn about vectors in two and three dimensions, and explore the steps for adding and subtracting both types of vectors.', 2, NULL, NULL, NULL, NULL, 2),
(6, 'Keplers Laws', 'In the early 1600s, Johannes Kepler proposed three laws of planetary motion. Kepler was able to summarize the carefully collected data of his mentor - Tycho Brahe - with three statements that described the motion of planets in a sun-centered solar system', 2, NULL, NULL, NULL, NULL, 3),
(9, 'New Topic1', 'New Topic2', 1, '2023-01-11 10:52:38', '2023-01-11 10:52:38', 49, NULL, 4),
(10, 'The Physics Topic', 'My Physics topic', 2, '2023-01-18 13:27:02', '2023-01-18 13:27:02', 49, NULL, 4),
(11, 'Topic for new course', 'New course topic', 8, '2023-01-18 19:14:34', '2023-01-18 19:14:34', 49, NULL, 1),
(0, 'C-sharp', 'This topic discusses naming and coding conventions as well as reserved words in Java. When you go through this chapter, you\'ll get some hands-on experience with writing in Java.', 1, '2023-02-16 15:29:22', '2023-02-16 15:29:22', 49, NULL, 5);
