(59, 'A plane traveling north at 150 ms is flying toward a runway. A cross-wind of 30 ms begins to blow from the east. The pilot realizes he is being blown off course. At what angle must he head in order to travel directly north?', '19 degrees east of north', '29 degrees east of north', '19 degrees west of north', '29 degrees east of south', 'answer_1', NULL, NULL, NULL, NULL, 'post', 2, 5, 94, 74, 'Hard'),
(60, 'Which of the following statement is best in accordance with Kepler\'s first law of planetary motion?', 'The orbits of planets form an ellipse- with the Sun at one focus.', 'Planets orbit in perfect circles- with the Sun slightly off-center.', 'All planets make one orbit of the Sun in exactly the same time period.', 'Planets farther from the Sun orbit proportionally faster.', 'answer_1', NULL, '2023-02-15 15:14:07', NULL, NULL, 'pre', 2, 6, 49, 80, 'Expert'),
(61, 'A total eclipse of the Sun occurs when the disc-like shape of the Moon completely covers the Sun- as seen from locations on Earth. However- this depends on the Moon being at its closest point to Earth in its orbit. Some eclipses- known as annular eclipses- show a thin ring of bright sunlight visible around the dark disc of the Moon. What is the relative position of the Moon- the Sun- and Earth during an annular eclipse?', 'The Moon is at apogee.', 'The Moon is at perigee.', 'Earth is at aphelion.', 'Earth is at perihelion.', 'answer_1', NULL, '2023-02-15 15:14:07', NULL, NULL, 'pre', 2, 6, 64, 69.5, 'Hard'),
(62, 'Because of its changing proximity to the Sun- which property does Kepler\'s Second Law of Planetary Motion predict will change during a planet\'s orbit?', 'orbital period', 'orbital minor axis', 'orbital speed', 'orbital eccentricity', 'answer_3', NULL, '2023-02-15 15:14:07', NULL, NULL, 'pre', 2, 6, 71, 11.5, 'Easy'),
