(32, 'The Law of Ellipses', 6, NULL, NULL, NULL, NULL, 'text', 'An ellipse is a special curve in which the sum of the distances from every point on the curve to two other points is a constant. The two other points (represented here by the tack locations) are known as the foci of the ellipse. The closer together that these points are, the more closely that the ellipse resembles the shape of a circle. In fact, a circle is the special case of an ellipse in which the two foci are at the same location. Kepler\'s first law is rather simple - all planets orbit the sun in a path that resembles an ellipse, with the sun being located at one of the foci of that ellipse', NULL, 'Easy', 1, 'Bloom', 'K', 'Pre-structure', 0),
(33, 'The Law of Equal Areas', 6, NULL, NULL, NULL, NULL, 'text', 'Kepler\'s second law - sometimes referred to as the law of equal areas - describes the speed at which any given planet will move while orbiting the sun. The speed at which any planet moves through space is constantly changing. A planet moves fastest when it is closest to the sun and slowest when it is furthest from the sun. Yet, if an imaginary line were drawn from the center of the planet to the center of the sun, that line would sweep out the same area in equal periods of time.', NULL, 'Easy', 16, 'Bloom', 'K', 'Pre-structure', 0),
