(42, 'History and Motivation', 1, NULL, NULL, NULL, NULL, 'text', 'In 1936, Howard Aiken had proposed his idea to build a giant calculating machine to the Physics Department, He was told by the chairman, Frederick Saunders, that a lab technician, Carmelo Lanza, had told him about a similar contraption already stored up in the Science Center attic.', NULL, 'Easy', 44, 'Bloom', 'K', 'Pre-structure', 0),
(43, 'Third generation', 1, NULL, NULL, NULL, NULL, 'image', 'In 1969, Data General introduced the Nova and shipped \na total of 50,000 at $8,000 each. The popularity of 16-bit computers, such as the \nHewlett-Packard 21xx series and the Data General Nova, led the way toward word lengths that were \nmultiples of the 8-bit byte. The Nova was first to employ medium-scale integration (MSI) circuits \nfrom Fairchild Semiconductor, with subsequent models using large-scale integrated (LSI) circuits. \nAlso notable was that the entire central processor was contained on one 15-inch printed circuit board.', '200px-Data_General_NOVA_System.jpeg', 'Easy', 57, 'Bloom', 'K', 'Pre-structure', 0),
(44, 'Fundamental Concepts of OO Programming', 2, NULL, NULL, NULL, NULL, 'video', 'Object-oriented approaches to software development are an important expansion of procedural approaches. Java explicitly supports both approaches, but you should focus on the object-oriented approach. This article compares the two approaches and explains the fundamentals of each.', 'https://www.youtube.com/embed/xFjsIWrRftE', 'Easy', 54, 'Bloom', 'K', 'Pre-structure', 0),
(45, 'Using Java for OO Programming', 2, NULL, NULL, NULL, NULL, 'text', 'A class represents a set of objects which share the same structure and behaviors. The class determines the structure of objects by specifying variables that are contained in each instance of the class, and it determines behavior by providing the instance methods that express the behavior of the objects. This is a powerful idea. However, something like this can be done in most programming languages. The central new idea in object-oriented programming -- the idea that really distinguishes it from traditional programming -- is to allow classes to express the similarities among objects that share some, but not all, of their structure and behavior. Such similarities can be expressed using inheritance and polymorphism.', NULL, 'Easy', 97, 'Bloom', 'K', 'Pre-structure', 0),
(46, 'Working with Classes', 3, NULL, NULL, NULL, NULL, 'text', 'The name of the class (and therefore the name of the file) is up to you. In programming, the name for something is called an identifier. An identifier is one or more characters long.The first character of an identifier cannot be a digit. The remaining characters can be a mix of alphabetic characters, digits, underscore, and dollar sign $. No spaces are allowed inside an identifier.\nIt is conventional for a class name to start with a capital letter, but this is not required by the compiler. However, follow this convention so your programs are easier to understand. A source file should always end with .java in lower case.', NULL, 'Easy', 22, 'Bloom', 'K', 'Pre-structure', 0),
(47, 'Importing Libraries', 3, NULL, NULL, NULL, NULL, 'text', 'Java comes with a rich set of pre-written classes that a programmer can use while developing Java programs. These classes are organized into packages. The following are just a few of the large number of different packages in Java at Oracles Java API Specifications:\njava.applet: The applet package provides the classes necessary to create an applet and the classes an applet uses to communicate with its applet context.\njava.awt: The awt package contains all of the classes for creating user interfaces and for painting graphics and images.\njava.lang: The lang package provides classes that are fundamental to the design of the Java programming language.\nIn order to use a Java class declared in these packages, you need to include an import statement before class declaration in your program. The import statement starts with the keyword import, followed by the name of the java package.', NULL, 'Easy', 17, 'Bloom', 'K', 'Pre-structure', 0),
(48, 'Physics and Technology.', 4, NULL, NULL, NULL, NULL, 'text', 'Some areas of technology that requires knowledge of physics are X-rays, lasers, scanners which are applications of physics are used in diagnosis and treatment of diseases.\nSatellite communication, internet, fibre optics are applications of internet which requires strong foundation in physics.\nIn the area of defense, physics has many applications e.g. war planes, laser-guided bombs which have high level accuracy.\nIn entrainment industry, knowledge of physics has use in mixing various colours to bring out the desirable stage effects', NULL, 'Easy', 21, 'Bloom', 'K', 'Pre-structure', 0),
(49, 'Pressure', 4, NULL, NULL, NULL, NULL, 'image', 'The SI unit of pressure is newton per square metre (N/m2). Pressure can also be expressed in pascals (Pa);\n1N/m2=1Pa\nAtmospheric pressure is sometimes expressed as mmHg, cmHg or atmospheres.\nFor a given amount of force, the smaller the area of contact the greater the pressure exerted. \nThis explains why it would be easier for a sharp pin to penetrate a piece of cardboard than a blunt \none when the same force is used.A solid resting on a horizontal surface exerts a normal contact force \nequals to its weight. The pressure of the solid on the surface depends on the area of contact.\nThe pressure between two solid surfaces depends on two things:\n(a) the force between the surfaces\n(b) the area of contact between the two surfaces.', 'pressure.gif', 'Easy', 54, 'Bloom', 'K', 'Pre-structure', 0),
(50, 'Introduction to Vectors', 5, NULL, NULL, NULL, NULL, 'text', 'Zadie lives in Chicago and decides to go on vacation, so she gets on a plane and flies 200 miles. \nWhere did she end up?\nYou can\'t know where she ends up without first knowing what direction she flew in, right? This is an \nexample of a vector, which is a quantity that has both a magnitude and a direction. In order to know \nwhere Zadie went on her vacation, you need to know both how far she went and in what direction.\nMany other physical quantities, such as force, velocity, and momentum, are also vectors. Vectors may be \neither two dimensional or three dimensional, depending on the situation.', NULL, 'Easy', 5, 'Bloom', 'K', 'Pre-structure', 0),
